{
	DROP TABLE IF EXISTS bancos;
	DROP TABLE IF EXISTS contratos;
	DROP TABLE IF EXISTS clientes;
	DROP TABLE IF EXISTS situacoes;
	DROP TABLE IF EXISTS orgaos;
	DROP TABLE IF EXISTS operacoes;
	DROP TABLE IF EXISTS usuarios;
	DROP TABLE IF EXISTS correspondentes;
	DROP TABLE IF EXISTS financeiras;
	DROP TABLE IF EXISTS infobancarias;
	DROP TABLE IF EXISTS inforesidenciais;
}

CREATE TABLE IF NOT EXISTS "operacoes" (
	"id" SERIAL NOT NULL PRIMARY KEY,
	"descricao" TEXT NOT NULL
);
);
CREATE TABLE IF NOT EXISTS "orgaos" (
	"id" SERIAL NOT NULL PRIMARY KEY,
	"nome" TEXT NOT NULL,
	"tipo" TEXT NOT NULL DEFAULT '---'
);
);
CREATE TABLE IF NOT EXISTS "situacoes" (
	"id" SERIAL NOT NULL PRIMARY KEY,
	"descricao" TEXT NOT NULL
);
);
CREATE TABLE IF NOT EXISTS "usuarios" (
	"id" SERIAL NOT NULL PRIMARY KEY,
	"nome" TEXT NOT NULL,
	"email" TEXT NOT NULL UNIQUE,
	"senha" TEXT NOT NULL,
	"nivel" TEXT NULL DEFAULT 'ROLE_USER',
	"avatar" TEXT NULL DEFAULT NULL,
	"regdate" TIMESTAMPTZ NULL DEFAULT LOCALTIMESTAMP
);
);

CREATE TABLE IF NOT EXISTS bancos (
	codigo VARCHAR(10) NOT NULL,
	nome TEXT NOT NULL
);
);
CREATE TABLE IF NOT EXISTS clientes (
	id SERIAL NOT NULL PRIMARY KEY,
	nome TEXT NOT NULL,
	cpf VARCHAR(20) NOT NULL UNIQUE,
	rg VARCHAR(50) NULL DEFAULT '00000000',
	expedicao DATE NULL DEFAULT NULL,
	nascimento DATE NULL DEFAULT NULL,
	naturalidade TEXT NULL DEFAULT 'Não informado',
	genitora TEXT NULL DEFAULT 'Não informado',
	genitor TEXT NULL DEFAULT 'Não informado',
	sexo VARCHAR(50) NULL DEFAULT 'Não informado',
	estado_civil VARCHAR(50) NULL DEFAULT 'Não informado',
	observacoes TEXT NULL DEFAULT NULL,
	regdate TIMESTAMPTZ 	
);
);
CREATE TABLE IF NOT EXISTS contratos (
	pid SERIAL NOT NULL PRIMARY KEY,
	cliente BIGINT REFERENCES clientes(id),
	nrcontrole VARCHAR(50) NOT NULL,
	nrcontrato VARCHAR(50),
	digitacao DATE NOT NULL,
	finalizacao DATE NOT NULL,
	prazo INT NOT NULL,
	total DECIMAL(10,2) NULL,
	parcela DECIMAL(10,2) NULL,
	liquido DECIMAL(10,2) NULL,
	referencia VARCHAR(50) NOT NULL DEFAULT 'LIQUIDO',
	tabela VARCHAR(50) NOT NULL DEFAULT 'NORMAL',
	percentual DECIMAL(10,2) NULL DEFAULT 0.00,
	comissao DECIMAL(10,2) NULL DEFAULT 0.00,
	observacoes TEXT NULL DEFAULT NULL,
	operacao BIGINT REFERENCES operacoes(id),
	financeira BIGINT REFERENCES financeiras(id),
	correspondente BIGINT REFERENCES correspondentes(id),
	situacao BIGINT REFERENCES situacoes(id),
	orgao BIGINT REFERENCES orgaos(id),
	usuario BIGINT NOT NULL,
	last_update TIMESTAMP NOT NULL
);
